import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      allImgs:[],
      randomImg: '',
    };
  }



  componentDidMount() {

    fetch('http://unsplash.com/photos', {
      method: 'GET',
    }).then(res => res.json())
    .then(response => console.log('Success:', response))
    .catch(error => console.error('Error:', error));
  }


  render() {
    return(
      <>
        <div class="content">
          <i className="fa fa-arrow-left left-icon"></i>
          <img class="image" src={this.state.randomImg} alt="backgroundImage"/>
          <i className="fa fa-arrow-right right-icon" onClick={this.handleClick}></i>
        </div>
      </>
    );
  }
}

export default App;
